import React from 'react';
import styled from 'styled-components';
import { withRouter } from 'react-router-dom';
import SearchTag from '../../components/searchTag/index';
import Checkbox from '../../components/checkbox/index';
import Dropdown from '../../components/dropdown/index';
import FilledButton from '../../components/filledButton/index';
const ProfileCreation1 = ({ history }) => {
  return (
    <StyledBody>
      <div>test1</div>
      <div>test2</div>
      <FilledButton
        onClick={() => {
          setTimeout(function() {
            history.push('/profile-creation/2');
          }, 120);
        }}
        text='Next'
      />
    </StyledBody>
  );
};

const StyledBody = styled.main`
  display: grid;
  grid-template-columns: 50% 50%;
  padding-top: 3rem;
`;

export default withRouter(ProfileCreation1);
